(2, 'Mesa de Ajedrez', 'mesa-de-ajedrez', '<p>Medida 0.70 cm x 0.70 cm x 0.75 cm de altura</p>\r\n<p>Mueble elaborado en madera tornillo, enchapado con enchape Jacaranda acabado en laca, se entrega con un juego de casino, un cubilete de cuero, un juego de fichas de ajedrez de madera torneada.</p>', NULL, '850.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-01-06 12:42:13', NULL, NULL, NULL, NULL),
