(25, 'Mesa de billas A (madera tornillo)', 'mesa-de-billas-a-(madera-tornillo)', '<p>Medida 2.80m x 1.55m x 0.80m confeccionado en madera tornillo selecto, bandas enchapadas en formica post formable color caoba, pizarra de cemento (composici&oacute;n nacional), pa&ntilde;o polyestel color verde o al escoger, troneras de bronce pulido canastillas de cuero vira, barandas con jebe nacional incluye los siguientes.</p>\r\n<p>Un juego de bolas importadas (16) (bolas chinas no recomendadas)<br /> Seis tacos fijos <br /> Un tri&aacute;ngulo y caja de bolas <br /> Una taquera  bolera <br /> Dos docena de tizas f&eacute;nix (tizas Chinas no recomendables)</p>', NULL, '5280.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-05-04 22:08:27', NULL, NULL, NULL, NULL),
(26, 'Mesa de billas (madera caoba)', 'mesa-de-billas-(madera-caoba)', '<p>Medida 2.80m x 1.55m x 0.80m confeccionado en madera caoba y laqueado en laca poli&eacute;ster color natural, pizarra de cemento (composici&oacute;n nacional), tela polyestel color verde o al escoger, troneras de bronce pulido, canastillas de cuero vira, barandas con jebe nacional, incluye los siguientes accesorios:</p>\r\n<p>Un juego de bolas importadas (16) (bolas chinas no recomendadas)<br /> Seis tacos fijos <br /> Un tri&aacute;ngulo y caja de bolas <br /> Una taquera  bolera <br /> Dos docena de tizas f&eacute;nix (tizas chinas no recomendables)</p>', NULL, '7000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(27, 'Mesa de billas (enchapada en formica)', 'mesa-de-billas-(enchapada-en-formica)', '<p>Medidas de 2.80m x 1.55m x 0.80cm confeccionado en madera tornillo y aglomerado de pino (placa masisa), enchapado en formica post formable color caoba; pizarra de cemento (composici&oacute;n nacional), tela polystel color verde o al escoger, troneras de bronce pulido, canastillas de cuero vira, barandas con  jebe nacional, incluye los siguientes accesorios:</p>\r\n<p>Un juego de bolas importadas (16) <br /> Seis tacos fijos <br /> Un triangulo y cajas de bolas. <br /> Una taquera bolera. <br /> Dos docena de tizas f&eacute;nix (tizas chinas no recomendables).</p>', NULL, '1300.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(28, 'Mesa de billas (madera tornillo)', 'mesa-de-billas-(madera-tornillo)', '<p>Medida 2.80m x 1.55m x 0.80m confeccionado en madera tornillo selecto, bandas enchapadas en formica post formable color caoba, pizarra de cemento (composici&oacute;n nacional), tela polyestel color verde o al escoger, troneras de bronce pulido canastillas de cuero vira, barandas con jebe nacional incluye los siguientes.</p>\r\n<p>Un juego de bolas importadas (16) <br /> Seis tacos fijos <br /> Un tri&aacute;ngulo y caja de bolas <br /> Una taquera  bolera <br /> Dos docena de tizas f&eacute;nix (tizas Chinas no recomendables)</p>', NULL, '2530.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(29, 'Taburete de colores', 'taburete-de-colores', '<p>Confeccionado en madera huayruro y completamente laqueado y dividido  en 6 cuerpos.</p>', NULL, '880.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
