(31, 'Taburete 3 PZS', 'taburete-3-pzs', '<p>Dimensiones del juego armado: <br />Alto: 75 cm. <br />Largo: 90 cm. <br />Ancho: 75 cm <br /> Colores: azul, amarillo, rojo <br /> Piezas: 3 <br /> Materiales: lino plastificado lavable y espuma de alta densidad</p>', NULL, '600.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(32, 'Mesa de ping pong americano ', 'mesa-de-ping-pong-americano', '<p>Medidas 1.52 &frac12;.m x 2.74m estructura confeccionado en tubo cuadrado de 1&rdquo; y &rdquo; plegable y pintado con esmalte al horno color negro o gris, consta de 4 garruchas que  permite que la mesa pueda deslizarse, tiene dos tableros de 15mm de aglomerado de pino (placa maciza), pintado a la piroxilina (duco) color verde pizarra o azul en acabado mate, incluye un juego de accesorios (2 paletas, 2 parantes, 1 malla, 3 pelotas).</p>', NULL, '715.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-01-06 12:05:09', NULL, NULL, NULL, NULL),
(33, 'Mesa de ping pong jumbo', 'mesa-de-ping-pong-jumbo', '<p>Medida 1.52 &frac12;&rdquo; m x 2.74m estructura confeccionado en tubo rectangular de 2&rdquo; x 1&rdquo; x 1.5 plegable y pintado con esmalte al horno color negro, blanco, gris. La estructura es gruesa y consta de  4 rodajes internos por tablero para que pueda abrirse los tableros, consta de 4 garruchas que permite que la mesa pueda deslizarse, tiene dos tableros de 15mm de aglomerado de pino (placa maciza), pintado a la piroxilina (duco) color verde pizarra o azul en acabado mate, incluye un juego de accesorios (2 paletas, 2 parantes, 1malla, 6 pelotas).</p>', NULL, '935.00', NULL, NULL, NULL, NULL, 0, 0, 2, '2011-09-30', '2011-11-07 12:10:25', NULL, NULL, NULL, NULL),
(34, 'Mesa de ping pong exportacion', 'mesa-de-ping-pong-exportacion', '<p>Medida 1.52 &frac12;&rdquo; m x 2.74m estructura confeccionado en tubo negro de 1 &frac12;&rdquo; x 1 &frac12;&rdquo; x 0.9 mm, 1 x 2 x 0.9 mm y &frac12;&rdquo; x 1 &frac12;&rdquo; x 0.9 mm, plegable y pintado con esmalte al horno color negro, blanco, gris. La estructura es gruesa y consta de  4 rodajes internos por tablero para que pueda abrirse los tableros, consta de 8 garruchas individual que permite que la mesa pueda deslizarse, tiene dos tableros de 18mm de aglomerado de pino (placa maciza), pintado a la piroxilina (duco) color verde pizarra o azul en acabado mate, incluye un juego de accesorios (2 paletas, 2 parantes, 1malla, 6 pelotas).</p>', '', '1350.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-10-18 14:43:40', NULL, NULL, NULL, NULL),
(35, 'Sapo t칤pico ', 'sapo-tipico', '<p>Medidas 60cm x 60cm x 90cm el mueble esta confeccionado en madera tornillo, pintado con pintura sint&eacute;tica color verde, tambi&eacute;n puede ser de color natural acabado en laca, el cabezal y la numeraci&oacute;n del sapo est&aacute;n forrados con carnaza selecta para que proteja a la madera del golpe de la ficha de bronce; los accesorios son de bronce pulido (sapo, mariposa, balancines, seguros y 12 fichas) se le entrega con una pizarrita.</p>', NULL, '490.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-12-07 09:45:00', NULL, NULL, NULL, NULL),
(36, 'Sapo desarmable ', 'sapo-desarmable', '<p>Medidas 60cm x 0.60cm x 90cm el mueble esta confeccionado en madera tornillo, laqueado en color natural, todas las piezas son desarmables y codificadas para mayor facilidad en el armado, los accesorios son de bronce pulido (sapo, mariposa, balancines, seguros y 12 fichas) se le entrega con una pizarrita (peso de 28 kilos).Se le entrega desarmado dentro de un malet&iacute;n elaborado de lona para su transporte.</p>', NULL, '550.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-11-07 12:07:31', NULL, NULL, NULL, NULL),
(37, 'Sapo el칠ctrico ', 'sapo-electrico', '<p>Elaborado de madera tornillo y placa masisa de 19mm, el tablero superior totalmente revestido en cuero carnaza, enchapado en formica, sistema el&eacute;ctrico empotrado en mueble, panel luminoso de acr&iacute;lico blanco con 20 focos, accesorios de bronce pulido (sapo, mariposa, balancines y fichas).</p>', NULL, '880.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(38, 'Hockey americano (1.m x 2.m)', 'hockey-americano-(1m-x-2m)', '<p>Mueble confeccionado en aglomerado de pino de 19mm (placa masisa), enchapado en formica y el color al escoger y esquineros de fibra de vidrio, cancha de formica color blanco marco de aluminio  pintados de color, marcadores electr&oacute;nicos con temporizador regulable y pantalla de iluminaci&oacute;n color lila, incluye como accesorios: dos mandos blancos y una ficha de juego color verde fosforescentes de confecci&oacute;n americana, incluye 50 fichas, amperaje 4.5 amperios- 220 voltios.</p>', NULL, '6000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(39, 'Hockey accesorios', 'hockey-accesorios', '<p>Mando S/. 70.00</p>\r\n<p>Ficha S/. 45.00</p>', NULL, '0.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(40, 'Fulbito comercial bombe', 'fulbito-comercial-bombe', '<p>Medidas 1.40m x 0.73 cm confeccionado en madera tornillo y base contra placado en triplay de 4 mm. Acabado en laca brillante a la piroxilina color natural, cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario de Deportes y Alianza Lima), varillas de fierro zincados de 5/8&rdquo; x 1.5 mm de pared, jugadores pintados con uniforme de su respectivo equipo, incluye 12 bolas de fulbito, 50 fichas.</p>', NULL, '975.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-11-07 12:10:00', NULL, NULL, NULL, NULL),
(41, 'Fulbito comercial', 'fulbito-comercial', '<p>Medidas 1.40m x 0.73cm confeccionado en madera tornillo y base contra placado en triplay de 4mm. Acabado en laca brillante a la piroxilina color natural, cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario de Deportes y Alianza Lima), varillas de fierro zincados de 5/8&rdquo; x 1.5mm de pared, jugadores pintados con uniforme de su respectivo equipo, incluye 12 bolas de fulbito, 50 fichas, 2 mangos, 2 jugadores</p>', NULL, '850.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(42, 'Fulbito comercial en formica', 'fulbito-comercial-en-formica', '<p>Accionado con fichas (traga fichas), confeccionado en aglomerado de pino (placa masisa), enchapado en formica post-formable color al escoger, la base es de metal pintado con pintura al horno,  cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario &ndash; Alianza Lima o el equipo que desee), varillas de tubo zincados de &rdquo; x 1.5mm de pared gruesa, jugadores pintados con uniforme de su respectivo equipo, se le entrega con  50 fichas ,1 jugador, 2 manija y 12 bolas.</p>', NULL, '1100.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2011-10-18 14:43:54', NULL, NULL, NULL, NULL),
(43, 'Fulbito comercial con base de metal', 'fulbito-comercial-con-base-de-metal', '<p>Confeccionado en madera tornillo y la base es de metal (pintado con pintura al horno), cancha de vidrio cristal triple de 6mm, pintado color verde, varillas de tubo zincados de 5/8&rdquo; x 1.5mm, pared gruesa, jugadores pintados con uniforme de su respectivo equipo, se le entrega con 50 fichas y 12 bolas.</p>', '', '950.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(44, 'Fulbito familiar enchapado en formica posformable', 'fulbito-familiar-enchapado-en-formica-posformable', '<p>Confeccionado en aglomerado de pino (placa masisa), enchapado en formica post-formable color al escoger, la base es de metal pintado con pintura al horno,  cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario &ndash; Alianza Lima, varillas de tubo zincados de &rdquo; x 1.5mm de pared gruesa, jugadores pintados con uniforme de su respectivo equipo, se le entrega con   ,1 jugador, 2 manija y 12 bolas.</p>', NULL, '750.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-09-30', '2012-01-06 12:06:01', NULL, NULL, NULL, NULL),
(45, 'Fulbito familiar', 'fulbito-familiar', '<p>Medidas 1.40m x 0.73cm confeccionado en madera tornillo y base contra placado en triplay de 4mm. Acabado en laca brillante a la piroxilina color natural, cancha de vidrio cristal triple de 6mm pintado color verde (dise&ntilde;o de gras con sticker de Universitario de Deportes y Alianza Lima), varillas de fierro zincados de &rdquo; x 1.5mm de pared, jugadores pintados con uniforme de su respectivo equipo, incluye 12 bolas de fulbito.</p>', NULL, '550.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(46, 'Rueda de Chicago (16 cabinas)', 'rueda-de-chicago-(16-cabinas)', '<p>Medidas altura de 16.2m. , ancho de base 12m.y largo de base 11m. Estructura confeccionada en metal (&aacute;ngulos, rieles y tubos). Estructuras met&aacute;licas  desarmables y pintadas. (Base zincromato y colores en gloss acr&iacute;lico).  Consta de 16 cabinas de 1.50m. de altura x 1.25m. de ancho en fibra de vidrio pintadas con esmalte al horno, con ventanas  recubiertas en acr&iacute;lico transparente y puerta met&aacute;lica.  Un motor trif&aacute;sico de 6hp x 220v.</p>', NULL, '138600.00', NULL, NULL, NULL, NULL, 0, 0, 0, '2011-09-30', '2012-05-04 22:17:48', NULL, NULL, NULL, NULL),
(47, 'Rueda de chicago (05 cabinas)', 'rueda-de-chicago-(05-cabinas)', '<p>Estructura confeccionada en metal (&aacute;ngulos, rieles y tubos) consta de 5 cabinas de fibra de vidrio con capacidad para 04 personas en cada cabina, total en el juego ingresan  (20 pasajeros entre ni&ntilde;os y adultos). Pintado totalmente con pintura al horno en colores variados incluye: motor el&eacute;ctrico y sistema el&eacute;ctrico (apagado y encendido), altura del juego es de 5m.</p>', NULL, '35200.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-09-30', NULL, NULL, NULL, NULL, NULL),
(48, 'Mundo infantil', 'mundo-infantil', '<p>Confeccionado en tubo negro estructural de &frac34;&rdquo; x 2mm base confeccionado en tubo estructural de 1&rdquo; x 2mm pintado con esmalte al horno en 4 colores diferentes, asientos y espaldar acolchado con espuma de 2&rdquo; y forrado con carpa lona concord, el techo confeccionado en  carpa lona de colores, con capacidad para 12 ni&ntilde;os debidamente sentados.</p>', NULL, '2530.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(49, 'Mundo infantil parque', 'mundo-infantil-parque', '<p>Confeccionado en tubo negro estructural de &frac34;&rdquo; x 2mm base confeccionado en tubo estructural de 1&rdquo; x 2mm pintado con esmalte al horno en 4 colores diferentes, el techo confeccionado en  carpa lona de colores, asientos y piso de madera huairuro y espaldar de tubo con capacidad para 12 ni&ntilde;os debidamente sentados. Con un eje de 6.5  cm. de di&aacute;metro con dos rodajes (uno c&oacute;nico y normal), m&aacute;s resistente considerando su uso p&uacute;blico.</p>', NULL, '2860.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-01-06 12:29:39', NULL, NULL, NULL, NULL),
(50, 'Trompo giratorio con sombrilla', 'trompo-giratorio-con-sombrilla', '<p>De 1.50m de di&aacute;metro, confeccionado en tubo negro de  &frac34;&rdquo;  x 2mm pintado con esmalte al horno en diferentes colores o al escoger, asientos y respaldar acolchados con espuma de 2&rdquo; y forrado en carpa lona en 4 colores (amarillo, rojo, verde y azul), la sombrilla forrada con lino plastificado en 4 colores, con capacidad para 8 ni&ntilde;os debidamente sentados.</p>', NULL, '1430.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-12-06 16:46:05', NULL, NULL, NULL, NULL),
(51, 'Trompo giratorio', 'trompo-giratorio', '<p>De 1.50m de di&aacute;metro, confeccionado en tubo negro de  &frac34;&rdquo;  x 2mm  pintado con esmalte al horno en diferentes colores o al escoger, asientos de madera huayruro, con capacidad para 8 &ndash; 10 ni&ntilde;os debidamente sentados.</p>', NULL, '1500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(52, 'Carrusel de caballitos', 'carrusel-de-caballitos', '<p>Medida de 2m de di&aacute;metro, confeccionado en tubo negro de diferentes medidas (1&frac14;&rdquo;, 1&rdquo;, &frac34;&rdquo;) x 2mm pintado con esmalte al horno color aluminio o al escoger, el piso es de madera huayruro acabado con laca brillante a la piroxilina, consta de 4 caballitos de fibra de vidrio pintados con hielco de diferentes colores y laqueados con esmalte transparente al horno. La sombrilla esta confeccionada en tubo negro de &frac34;&rdquo; x 2mm pintado con esmalte al horno y forrado con carpa lona en 4 colores diferentes (amarillo, verde, rojo y azul).</p>', NULL, '5500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(53, 'Carrusel de animalitos', 'carrusel-de-animalitos', '<p>Medida de 2m de di&aacute;metro, confeccionado en tubo negro de diferentes medidas (1&frac14;&rdquo;, 1&rdquo;, &frac34;&rdquo;) x 2mm pintado con esmalte al horno color aluminio o al escoger, el piso es de madera huayruro acabado con laca brillante a la piroxilina, consta de 4 animalitos de fibra de vidrio pintados con hielco de diferentes colores y laqueados con esmalte transparente al horno. La sombrilla esta confeccionada en tubo negro de &frac34;&rdquo; x 2mm pintado con esmalte al horno y forrado con carpa lona en 4 colores diferentes (amarillo, verde, rojo y azul).</p>', NULL, '5500.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-01-06 12:30:25', NULL, NULL, NULL, NULL),
(54, 'Carrusel solo', 'carrusel-solo', '<p>Medida de 4.27.m de di&aacute;metro, confeccionado en tubo negro de diferentes medidas pintado con esmalte al horno color aluminio o al escoger, el piso es de madera acabado con laca brillante a la piroxilina, La sombrilla esta confeccionada en tubo negro pintado con esmalte al horno y forrado con carpa lona en 4 colores diferentes.</p>', NULL, '10780.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(55, 'Carrusel giratorio', 'carrusel-giratorio', '<p>Medida de 2.50m de di&aacute;metro, confeccionado en tubo negro de metal (1&frac14;&rdquo;, 1&rdquo;, x 2mm) pintado con esmalte al horno color aluminio o al escoger, el piso es de madera huairuro machihembrado  acabado en barniz marino, barandas de seguridad pintado en esmalte al horno color rojo (tubo negro de 1&rdquo; x 2mm), Con un eje de 6.5  cm. de di&aacute;metro con dos rodajes (uno c&oacute;nico y normal), el sistema giratorio es de impulso mec&aacute;nico manual.</p>', NULL, '3080.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-11-07 12:11:54', NULL, NULL, NULL, NULL),
(56, 'Animalitos en fibra de vidrio', 'animalitos-en-fibra-de-vidrio', '<p>Animalitos en fibra de vidrio</p>', NULL, '880.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-11-07 12:10:54', NULL, NULL, NULL, NULL),
