(58, 'Casita con bancas', 'casita-con-bancas', '<p>Confeccionado en aglomerado (placa masisa de 18mm) pintado en colores, estructura de piso  en madera huayruro  laqueado color natural o pintado en esmalte Gloss, techo a dos aguas y dos bancas.</p>\r\n<p><strong>Medidas:</strong> <br /> Largo : 2.80 m<br /> Ancho : 1.20 m<br /> Altura : 2.20 m</p>', NULL, '4670.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(59, 'Casita sola', 'casita-sola', '<p>Confeccionado en aglomerado (placa masisa de 18mm) pintado en colores, estructura  en madera huayruro de 3&rdquo; x 3&rdquo;  laqueado color natural, techo a dos aguas y dos bancas.</p>\r\n<p><strong>Medidas :</strong><br /> Largo : 1.20m <br /> Ancho : 1.20m <br /> Altura : 2.20m</p>', NULL, '1716.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(60, 'Casita con tobogan', 'casita-con-tobogan', '<p>Confeccionado totalmente  en madera huayruro de 3&rdquo; x 3&rdquo;  laqueado color natural, techo a dos aguas, pared lateral con palestras de fibra de vidrio de colores, con  terraza, puerta  y ventana.</p>\r\n<p><strong>JUEGOS QUE INCLUYE :</strong> <br /> 01 TOBOGAN DE FIBRA DE VIDRIO DE 1M <br /> 01 ESCALERA DE MADERA</p>\r\n<p><strong>MEDIDAS :</strong> <br /> Largo: 2.0 m <br /> Ancho: 1.80 m <br /> Altura: 2.80m</p>', NULL, '5216.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(61, 'Balancin doble', 'balancin-doble', '<p>Confeccionado en madera huayruro laqueado en color natural, base y agarraderas confeccionados en tubo negro estructural (&frac34;&rdquo; x 2mm) pintado con esmalte al horno en colores, plataformas de resortes de &aacute;ngulos de 1&frac12;&rdquo; resortes de &rdquo;  de espesor pintado en esmalte al horno en colores y canales &ldquo;U&rdquo; de 2&rdquo; x 3&rdquo; x &rdquo; pintado en esmalte al horno en colores.</p>\r\n<p><strong>Medidas :</strong> <br /> Marco de base : 1.m x 1.m metal. <br /> Marco de agarraderas : 0.65cm x 0.55cm. <br /> Base de resorte : 1 &frac12;&rdquo; x 8&rdquo; madera. <br /> Estructura de asientos : 3&rdquo; x 3&rdquo; x 1.10m madera.</p>', NULL, '1450.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-01-06 12:32:23', NULL, NULL, NULL, NULL),
(62, 'Caballito (4 resortes)', 'caballito-(4-resortes)', '<p>Confeccionado en fibra de vidrio (2 capas), accionado en cuatro resortes de alta tensi&oacute;n, pintado en esmalte al horno en colores variados, su estructura es de tubo cuadrado de 1&rdquo; x 1.5&rdquo;, tambi&eacute;n pintado en esmalte al horno colores variados.</p>', NULL, '790.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(63, 'Balancin personal', 'balancin-personal', '<p>Figuras confeccionadas en madera huayruro de 1&rdquo; &frac14; espesor, acabado en laca brillante y estructura pintado con un esmalte al horno, base de resorte de suspensi&oacute;n con anclaje de tubo negro de &frac34; x 2.00.</p>', NULL, '1100.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-05-04 22:15:21', NULL, NULL, NULL, NULL),
(64, 'Balancin fibra de vidrio', 'balancin-fibra-de-vidrio', '<p>Confeccionado en fibra de vidrio de alta resistencia  de 26 Kg., con base de resorte de suspensi&oacute;n con anclaje de tubo negro de &frac34;  x 2.</p>', NULL, '1600.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(65, 'Mecedora', 'mecedora', '<p>Confeccionado en tubo cuadrado de 7/8 x 1.5mm pintado con anticorrosivo y esmalte al horno en colores al escoger, asientos y respaldar en madera huairuro barnizado.</p>', NULL, '600.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2012-01-06 12:29:56', NULL, NULL, NULL, NULL),
(66, 'Piscina de Pelotas Baby', 'piscina-de-pelotas-baby', '<p>Medidas de 1.50m x 2m x 1.80m, confeccionadas en tubo negro de 1&frac14;&rdquo; x 2mm pintado en esmalte al horno color aluminio y acolchado con espuma de 2&rdquo; de espesor y forrado con carpa lona en 4 colores (amarillo, rojo, verde y azul) asimismo el techo. La tina es de carpa lona con canastilla de correas de nylon debidamente cocido con hilo nylon, templada con resortes de 18cm. La piscina esta cercada con malla de nylon color verde para su mayor resistencia, el ingreso es circular acolchado y forrado, incluye una escalera de metal con paso de madera, 6 porta zapateras y 750 PELOTAS.</p>', NULL, '3135.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-10-18 14:49:14', NULL, NULL, NULL, NULL),
(67, 'Piscina de Pelotas Mixto A', 'piscina-de-pelotas-mixto-a', '<p>Medidas 3.m x 3.m x 2.50m La piscina es de 1.50m x 2.m x 1.80m, confeccionado en tubo negro de 1&frac14;&rdquo; x 2mm pintado en esmalte al horno color aluminio y acolchado con espuma de 2&rdquo; de espesor y forrado con carpa lona en 4 colores (amarillo, rojo, verde y azul) asimismo el techo. La tina es de carpa lona con canastilla de correas de nylon debidamente cocido con hilo nylon, templada con resortes de 18cm. La piscina esta cercada con malla de nylon color verde para su mayor resistencia, el ingreso es circular acolchado y forrado, incluye una escalera de metal con paso de madera, 6 porta zapateras y mil PELOTAS.</p>', NULL, '14300.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-11-07 12:07:14', NULL, NULL, NULL, NULL),
(68, 'Tobogan Inflable Mu침ecos', 'tobogan-inflable-munecos', '<p>Confeccionado en tela importada de colores, tiene las siguientes caracter&iacute;sticas medidas 4.40m ancho, 10.m largo y 8.m de altura, una escalera intermedio y dos resbalones lateral con tres arcos en la parte delantera adornados con mu&ntilde;ecos, en la parte posterior un techo parcial sobre los resbalones y escaleras con respaldar, motor soplador de dos caballos de fuerza.</p>', NULL, '33000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(69, 'Tobogan Inflable Palmeras', 'tobogan-inflable-palmeras', '<p>Confeccionado en tela importada de colores, tiene las siguientes caracter&iacute;sticas medidas 3.80m ancho, 8.m largo y 7.m de altura, una escalera intermedio y dos resbalones laterales con palmeras de adorno, un techo parcial en la parte superior de la escalera y resbalones, motor soplador de dos caballos de fuerza de alta velocidad.</p>', NULL, '27500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(70, 'Tobogan Inflable Payaso', 'tobogan-inflable-payaso', '<p>Confeccionado en tela importada de colores, tiene las siguientes caracter&iacute;sticas medidas 3.80m ancho, 8.m largo y 7.m de altura, una escalera intermedio y dos resbalones laterales, un techo parcial con adorno de payaso en la parte superior de la escalera y resbalones, motor soplador de dos caballos de fuerza de alta velocidad.</p>', NULL, '29700.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
