(72, 'Tobogan Inflable Grap Kids', 'tobogan-inflable-grap-kids', '<p>Confeccionado en material importado en colores (rojo, amarillo, verde y azul, morado, blanco y fucsia), tiene las siguientes caracter&iacute;sticas medidas 3.80m ancho, 8.m largo y 7.m de altura, una escalera intermedio y dos resbalones laterales, un techo parcial en la parte superior de la escalera y resbalones, motor soplador de dos caballos de fuerza de alta velocidad.</p>', NULL, '25300.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(73, 'Tobogan Inflable Robot', 'tobogan-inflable-robot', '<p>Confeccionado en tela importada de colores, 5m. de ancho, 8.20.m largo y 7.m de altura, una escalera intermedio y dos resbalones laterales, se le entrega con un motor soplador de dos caballos de fuerza.</p>', NULL, '46200.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
