(80, 'Tobog치n Barco', 'tobogan-barco', '<p>Confeccionado en fibra de vidrio contra-placado de 4mm de espesor, pintado al horno, estructura de metal (tubo negro de 1 &frac12;&rdquo;, 1&rdquo; x &frac34; x 2mm), pintado al horno color aluminio y 2.90mt de altura.</p>', NULL, '0.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
(81, 'Tobog치n Tubular con Cabeza de Drag칩n', 'tobogan-tubular-con-cabeza-de-dragon', '<p>Confeccionado en fibra de vidrio contra placado de 720mm de di&aacute;metro y 4mm de espesor, pintado con hielco de color a escoger,  estructura de metal pintado al horno, (Tubo negro de 1&frac14;&rdquo; x 2.0mm anclado al terreno con concreto) este tobog&aacute;n de desplaza de una altura de 5mts y se desliza en forma de SIG SAG en  un largo de 10mts, tambi&eacute;n lleva ventanas a ambos lados a lo largo del deslizamiento y la salida tiene una cabeza de DRAGON como aparece en la fotograf&iacute;a que  mostramos.</p>', NULL, '26400.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-04', '2011-12-06 17:06:09', NULL, NULL, NULL, NULL),
(82, 'Tobog치n Tubular Caracol con Cabeza de Serpiente', 'tobogan-tubular-caracol-con-cabeza-de-serpiente', '<p>Confeccionado en fibra de vidrio contra-placado de 4mm de espesor, pintado al horno tipo serpiente, estructura de metal (tubo negro de 1 &frac12;&rdquo;, 1&rdquo; x &frac34; x 2mm), pintado al horno color aluminio y 2.90mt de altura.</p>', NULL, '16500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-04', NULL, NULL, NULL, NULL, NULL),
