(108, 'Columpio Cu치druple con 2 Asientos y  2 Calesas', 'columpio-cuadruple-con-2-asientos-y-2-calesas', '<p>Medida de 2.10m de altura x 3.80 de largo, la estructura esta confeccionado en tubo negro estructural, el travesa&ntilde;o es de 2&rdquo; x 2mm y los parantes de 1&frac12;&rdquo; x 2mm pintado con esmalte al horno, los columpios esta accionado x un sistema de rodajes (mayor durabilidad para el uso publico), asientos de madera huayruro  y cadenas galvanizados de 3/16,  con dos calesas confeccionados con tubo cuadrado.</p>', NULL, '2100.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-05', NULL, NULL, NULL, NULL, NULL),
(109, 'Columpio Triple Mixto Asiento Calesa Balanc칤n', 'columpio-triple-mixto-asiento-calesa-balancin', '<p>Medida de 1.90m de altura por 2.80m de largo, la estructura esta confeccionado en tubo negro estructural, el travesa&ntilde;o es de 2&rdquo; x 2mm y los parantes de 1&frac14;&rdquo; x 2mm pintado con esmalte al horno, los columpios esta accionado por un sistema de rodajes (mayor durabilidad para el uso publico), balancines confeccionados con tubo negro estructural de &frac34; x 2mm y asientos de fibra de vidrio y cadenas galvanizados de 3/16, calesas confeccionados con tubo cuadrado y asientos de Fibra de Vidrio.</p>', NULL, '1300.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-05', '2011-10-15 11:25:02', NULL, NULL, NULL, NULL),
(110, 'Pasamanos Circular', 'pasamanos-circular', '<p>Confeccionado en tubo negro de 2 &ldquo;,1 &frac12;&rdquo; x 2.0mm y &frac34;&rdquo; x 2mm pintado en esmalte gloss de colores tiene una altura de 2.m x 2.m de di&aacute;metro y 3.20 m de largo, anclado a 0.50m de profundidad.</p>', NULL, '1850.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-05', '2012-01-06 12:34:06', NULL, NULL, NULL, NULL),
(111, 'Pasamanos Culebra', 'pasamanos-culebra', '<p>Confeccionado en tubo negro de 2&rdquo; x 2.5mm y &frac34;&rdquo; x 2mm pintado en esmalte gloss de colores tiene una altura de 2.m 2.75m de largo.</p>', NULL, '1200.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-10-05', '2012-01-06 12:33:48', NULL, NULL, NULL, NULL),
