(204, 'Modulo Colegio', 'modulo-colegio', '<p>Tobog&aacute;n caracol Tubular de 65cm de di&aacute;metro en fibra de vidrio.<br /> Pasarela de madera.<br /> Barandas de pasarela con postes de 4'''' x 2''''.<br /> Techo de casita a dos aguas de madera.<br /> T&uacute;nel de 65cm de di&aacute;metro con cubo de 90cm de fibra de vidrio.<br /> Una torre de 2m x 2m con plataforma de 1.80m de altura.<br /> Escalera  con pasos de madera  y pasamanos de madera.<br /> Trepado de sogas de 1.80m de altura.<br /> Techo a dos aguas de madera.<br /> Tres en raya (michi).<br /> Un arenero.<br /> Pintado de pista negro con rayas blancas.<br /> Dos paneles de aglomerado.<br /> &Aacute;rea de pasto artificial de 1m x 4m.<br /> Dos &aacute;rboles seg&uacute;n dise&ntilde;o.<br /> Tres nubes seg&uacute;n dise&ntilde;o en tripley de 4mm.<br /> Tres figuras (chancho, sapo y mariposa en tripley y gigantografiados en baner.</p>\r\n<p><strong>Informe T&eacute;cnico:</strong><br /> Pisos de columnas confeccionadas en madera huayruro y parantes 4" x 4" de grosor, los pisos del circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso publico, debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.<br /> Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas  pintado con anticorrosivo y esmalte al horno de diferentes colores.<br /> Desarmables y ensamblados con pernos zincados.<br /> Tobog&aacute;n, t&uacute;nel tubular y cubo de fibra de vidrio pintado con hielco de diferentes colores y laqueados en laca al horno transparente.<br /> Modulo anclado con &aacute;ngulos de metal y asegurados con tirafones.</p>', '<iframe width="560" height="315" src="http://www.youtube.com/embed/pmIa5WZ8JlU?rel=0" frameborder="0" allowfullscreen></iframe>', '24500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-18', '2011-12-29 15:13:43', NULL, NULL, NULL, 5),
(205, 'Modulo Carmen de la Legua', 'modulo-carmen-de-la-legua', '<div>\r\n<p>Cuatro columnas con plataforma (de 1m x 1m).&nbsp;<br />Cuatro techos de fibra de vidrio.&nbsp;<br />Un t&uacute;nel de fibra de vidrio pintado en esmalte al horno.&nbsp;<br />Un puente colgante, piso de madera y pasamanos de madera Huayruro.&nbsp;<br />Un puente en arco, piso de madera y pasamanos de madera.&nbsp;<br />Un tubo bombero de metal pintado en esmalte al horno.&nbsp;<br />Una rampa de madera (con sogas tipo alpinista).&nbsp;<br />Tobog&aacute;n tubular caracol de fibra de vidrio de 2.20m de altura con cabeza de serpiente.&nbsp;<br />Tobog&aacute;n caracol abierto de fibra de vidrio de 2m de altura.&nbsp;<br />Un michi de madera (tres en raya).&nbsp;<br />Dos escaleras con pasos de madera.&nbsp;<br />Una escalera sube o baja culebra de metal.&nbsp;<br />Un pasamano curvo de metal.&nbsp;<br />Escalera de pirata (sogas).&nbsp;<br />Tobog&aacute;n curvo de fibra de vidrio.&nbsp;<br />Puente de escalones.</p>\r\n<p><strong><strong>Informe T&eacute;cnico:</strong></strong><br />Las columnas con plataforma est&aacute;n confeccionadas en madera huayruro y parantes de 4'''' x 4'''' de grosor, los pisos del circuito confeccionados en madera huayruro acabado en una pulgada de grosor, por consideraci&oacute;n al uso publico debe ser duradero y resistente, totalmente laqueado y barnizado en barniz marino transparente.&nbsp;<br />Accesorios met&aacute;licos: confeccionados en tubo negro estructural de diferentes medidas (1&frac12;'''', 1&frac14;'''', &frac34;''''), y varilla lisa de 3/8''''. Pintado en esmalte al horno de diferentes colores.&nbsp;<br />Desarmables y ensamblados con pernos zincados.&nbsp;<br />Toboganes de fibra de vidrio pintado con hielco de colores laqueado en laca al horno transparente.&nbsp;<br />Plataformas decoradas con hojas de enredadera y otros artificiales, debidamente ancladas al piso con baseado de concreto armado.&nbsp;<br />Aplicaci&oacute;n de undercoating en las bases (brea).</p>\r\n</div>', '<iframe width="560" height="315" src="http://www.youtube.com/embed/OOb10Zf4_Ps?rel=0" frameborder="0" allowfullscreen></iframe>', '38500.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-18', '2011-12-29 15:13:33', NULL, NULL, NULL, 4),
(206, 'Mesa de billas B (madera tornillo)', 'mesa-de-billas-b-(madera-tornillo)', '<p>Medida 2.80m x 1.55m x 0.80m confeccionado en madera tornillo selecto, bandas enchapadas en formica post formable color caoba, pizarra de cemento (composici&oacute;n nacional), pa&ntilde;o polyestel color verde o al escoger, troneras de bronce pulido canastillas de cuero vira, barandas con jebe nacional incluye los siguientes.</p>\r\n<p>Un juego de bolas importadas (16) (bolas chinas no recomendadas) <br /> Seis tacos fijos <br /> Un tri&aacute;ngulo y caja de bolas <br /> Una taquera  bolera <br /> Dos docena de tizas f&eacute;nix (tizas Chinas no recomendables)</p>', NULL, '5000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-24', NULL, NULL, NULL, NULL, NULL),
(207, 'Mesa de billas C (madera tornillo)', 'mesa-de-billas-c-(madera-tornillo)', '<p>Medida 2.80m x 1.55m x 0.80m confeccionado en madera tornillo selecto, bandas enchapadas en formica post formable color caoba, pizarra de cemento (composici&oacute;n nacional), tela polyestel color verde o al escoger, troneras de bronce pulido canastillas de cuero vira, barandas con jebe nacional incluye los siguientes.</p>\r\n<p>Un juego de bolas importadas (16) <br /> Seis tacos fijos <br /> Un tri&aacute;ngulo y caja de bolas <br /> Una taquera  bolera <br /> Dos docena de tizas f&eacute;nix (tizas Chinas no recomendables)</p>', NULL, '3300.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2011-10-26', NULL, NULL, NULL, NULL, NULL),
(208, 'Modulo Torre de Escaleras', 'modulo-torre-de-escaleras', '<p><strong>Area 2.60m per&iacute;metro.</strong></p>\r\n<p>Elaborado en tubo negro de 2'''', 1&frac12;'''' y &frac34;'''' x 2mm, pintado con pintura al horno de colores variados.<br /> Una escalera espiral.<br /> Una escalera de tri&aacute;ngulos.<br /> Una escalera de pasos cuadrados de metal.<br /> Una escalera cl&aacute;sica.<br /> Plataforma de 1m x 1m x 1.50 de altura.<br />Piso de plataforma de madera huairuro de 1'''' de grosor.<br /> Altura de modulo 2.70m.<br /> &Aacute;rea de instalaci&oacute;n  2m x 2m.</p>', NULL, '2850.00', NULL, NULL, NULL, NULL, 0, 0, 1, '2011-11-07', '2012-01-06 12:35:33', NULL, NULL, NULL, 24),
