(221, 'Sube y Baja de Metal (4 personas)', 'sube-y-baja-de-metal-(4-personas)', '<p>Confeccionado en tubo negro estructural de 2 1/2'''' x  3mm y 2'''' x 2mm y  0.50cm de  altura con ejes de 1.60m de largo con asientos de fibra de  vidrio pintado en esmalte al horno en colores.</p>', NULL, '1550.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2012-04-12', NULL, NULL, NULL, NULL, NULL),
