(225, 'Carrusel de conejitos', 'carrusel-de-conejitos', '<p>Medida de 2m de di&aacute;metro, confeccionado en tubo negro de diferentes medidas (1&frac14;&rdquo;, 1&rdquo;, &frac34;&rdquo;) x 2mm pintado con esmalte al horno color aluminio o al escoger, el piso es de madera huayruro acabado con laca brillante a la piroxilina, consta de 4 conejitos de fibra de vidrio pintados con hielco de diferentes colores y laqueados con esmalte transparente al horno. La sombrilla esta confeccionada en tubo negro de &frac34;&rdquo; x 2mm pintado con esmalte al horno y forrado con carpa lona en 4 colores diferentes (amarillo, verde, rojo y azul).</p>', '', '6000.00', NULL, NULL, NULL, NULL, 0, NULL, 1, '2012-09-03', NULL, NULL, NULL, NULL, NULL),
